  input: '"TEXT","F3XA","C00055582","The report has been amended to reflect the correct
    Calendar Year-to-Date calculations for all lines of the report.  The disbursement
    for FEA Worker Accommodations has been corrected to disclose the correct description
    for FEA GOTV activity.  Please see our memo to the amended 30-Day Post General
    Report (10/14/04-11/22/04) FEC -167021, section 5.  Payment for Fax Service disclosed
    on Schedule H4 is for broadcast fax services to our 62 county committee organizations.
    Typically these faxes are press releases on generic party activity that are sent
    to the county committees and media outlets.  Calculation errors resulted in the
    over-transfer of non-federal funds during this reporting period (transfer of 12/6/04).  Please
    be advised the Committee has transferred back to the non-federal account the excessive
    funds received during the 10/1/2004-12/31/2004 time period.  The transfer of $
    4,784.98 will be disclosed on the appropriate schedule of the June 2005 filing.  The
    transfer disclosed on Schedule B to a non-federal account of the Committee did
    not finance any activity in connection with a federal election or allocated activity
    of the Committee.  The payments disclosed on Schedule H4, for Office Coordinator
    and Office Coordinator Fee, were for temporary coordinators who are not employees
    of the Committee, who engaged in both federal and non-federal activity on behalf
    of the Committee and no more than 25% of their time was spent on Federal election
    activity."'
